  const dispatch = useDispatch();
  const todos = useSelector((state) => state.counter.list);
  console.log(todos);
  // const onDeleteTodo = (id) => {
  //   dispatch(deleteTodo(id));
  // };

  // const onToggleStatusTodo = (id) => {
  //   dispatch(toggleTodo(id));
  // };

  return (
    <div>
      <h2>working</h2>
      <div>
        {todos.map((x) => {
          <div>
            <div key={x.id}>
              <h2>{x.title}</h2>
              <div>{x.body}</div>
            </div>
          </div>;
        })}
      </div>
      <h2>Done</h2>
      <div></div>
    </div>
  );
};

export default List;
